window.bookSummaryJSON = "<p>For Tess Kendrick, a junior at the elite Hardwicke School in Washington, DC, fixing runs in the family. But Tess has another legacy, too, one that involves power and the making of political dynasties. </p> <p>When Tess is asked to run a classmate's campaign for student council, she agrees. But when the candidates are children of politicians, even a high school election can involve life-shattering secrets. Meanwhile, Tess' guardian has also taken on an impossible case, as a terrorist attack calls into doubt who can - and cannot - be trusted on Capitol Hill. </p> <p>Tess knows better than most that power is currency in Washington, but she's about to discover firsthand that power always comes with a price. </p> <p>Perfect for fans of Harlan Coben and Ally Carter, the second audiobook in this thrilling series will leave listeners breathless. </p>"; 
